text:
The American worker has been suffering under a trade war for the last 40 years. It's gutted the heartland, shipped jobs overseas, and in states like West Virginia, left our people w/ breadcrumbs.

@POTUS GETS IT!

I'm for FREE &amp; FAIR trade for our manufacturers here in the U.S. https://t.co/gMis14UM2C

💯 

@marcorubio is right. This is a totally unacceptable outcome. 

President Trump can’t get back in the White House soon enough. We need his strong leadership more than ever.
